import React, { Component } from 'react';
import axios from 'axios';
import Link from 'react-router-dom';
import App from '../App';
import UserRow from './UserRow';

class UserList extends Component {
    constructor(props) {
        super(props)
        this.state = {user: ''}
    }
    
    render() {
        return (
            <div>
                <h2>Page UserList</h2>
            </div>
        );
    }
}

export default UserList;
